INSERT INTO `ecan_message` VALUES ('8a10bfbe50a20bcd0150a217190f0002','phone消息测试一','phone消息测试一phone消息测试一phone消息测试一phone消息测试一','U','S','2015-10-26 11:00:38','1','2015-10-26 11:00:34'),('8a10bfbe50a29fd70150a703e6450003','phone消息测试二','君不见，黄河之水天上来，奔流到海不复回。\n君不见，高堂明镜悲白发，朝如青丝暮成雪！\n人生得意须尽欢，莫使金樽空对月。\n天生我材必有用，千金散尽还复来。\n烹羊宰牛且为乐，会须一饮三百杯。\n岑夫子，丹丘生，将进酒，杯莫停。\n与君歌一曲，请君为我倾耳听。\n钟鼓馔玉不足贵，但愿长醉不复醒。\n古来圣贤皆寂寞，惟有饮者留其名。\n陈王昔时宴平乐，斗酒十千恣欢谑。\n主人何为言少钱，径须沽取对君酌。\n五花马、千金裘，呼儿将出换美酒，与尔同销万古愁！','U','S','2015-10-27 09:57:45','1','2015-10-27 09:57:42'),('8a10bfbe50c68fd80150e63c7b9d0033','双11活动','双11优惠促销','U','S','2015-11-08 16:35:38','1','2015-11-08 16:35:34'),('8a10bfbe50f1a0c80151035e593b0012','备战双12','备战双12备战双12备战双12备战双12备战双12备战双12备战双12备战双12备战双12','U','S','2015-11-14 08:21:36','1','2015-11-14 08:21:33'),('8a10bfbe510595c40151085c21180004','周末技术大比武','周末技术大比武周末技术大比武周末技术大比武周末技术大比武\n周末技术大比武','U','S','2015-11-15 07:37:17','1','2015-11-15 07:37:14'),('8a10bfbe510595c40151192f45b70007','顶顶顶','   断水断电','U','S','2015-11-18 14:01:48','1','2015-11-18 14:01:47'),('8a10bfbe514365ad015153ba7bf9000e','继续备战双12','双12倒计时进行中。\n13','U','S','2015-11-29 22:51:51','1','2015-11-29 22:51:49'),('8a10bfbe51613b470151649a2aa20001','1203测试','1203测试','U','S','2015-12-03 05:30:06','1','2015-12-03 05:30:03'),('8a10bfbe51613b47015165c900fc0015','顶顶顶','舒服舒服','U','S','2015-12-03 11:00:52','1','2015-12-03 11:00:50'),('8a10bfbe51613b4701516737b33f001a','12322312312','121321321','U','S','2015-12-03 17:41:23','1','2015-12-03 17:41:22'),('8a10bfbe51613b47015167394fc2001c','qqw膛','三叶草','U','S','2015-12-03 17:43:09','1','2015-12-03 17:43:07'),('8a10bfbe51613b47015167469f25001e','adkdlsall','lkdaldlkd','U','S','2015-12-03 17:58:40','1','2015-12-03 17:57:40'),('8a10bfbe51613b470151674715a00020','校园黑帮akl','大狼饭量大看来是\n','U','S','2015-12-03 17:58:37','1','2015-12-03 17:58:10'),('8a10bfbe51613b470151674771c50022','在；阿文','隔篱邻舍了','U','S','2015-12-03 17:58:36','1','2015-12-03 17:58:34'),('8a10bfbe51613b4701516b34346f0032','单独','的','U','S','2015-12-04 