INSERT INTO `mw_article` VALUES (3,'5月产品动态体验课程设计和执行-培训短片回顾','wxxw','','&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 5月的北京，春天很快飘过，夏天的闷热已撵着春天的脚步来到。大众汽车学院最新设计研发的针对培训师的“产品动态体验课程设计和执行”TtT课程如期完成。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; 欲知课程如何，速览我们精彩剪辑的培训短片。（建议在WIFI环境下观看以下视频）&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;video src=&quot;http://academy.vgc.com.cn/video/Testdrivevideo_2min.mp4&quot; preload=&quot;load&quot; controls=&quot;controls&quot;&gt;&lt;/video&gt; &lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;培训课程简介&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 大众汽车学院推出的“产品动态体验课程培训与执行”的培训师培训(TtT)，以销售产品培训师为重点授课对象，主要围绕新产品上市培训如何设计动态体验科目，以及如何更加专业地执行动态体验项目为主要内容展开培训，进而帮助销售产品培训师提升产品动态体验课程的设计及执行的专业能力。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 通过该课程的学习，学员能够：&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 熟悉产品培训中动态体验环节的执行步骤，并能够应用到实际的培训工作当中；&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 掌握常见的动态体验科目的设计方法及设计(体验)要点，包括每一个科目的体验目的，基本搭建要求，设计流程，设计要点(体验)要点，以及所需工具，适用场地等内容，通过学习最终达到能够设计出体现本品优势的动态体验项目。&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;课程结构&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本课程分为&lt;strong&gt;课前学习，课堂教学，&lt;/strong&gt;以及&lt;strong&gt;课后回顾&lt;/strong&gt;三部分。&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/images/201407081148.jpg&quot; /&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;课程教学内容简介&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 课程教学共3天课程，具体安排为:&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/images/list0708.jpg&quot; /&gt;&lt;br /&gt;&lt;/p&gt;','/uploads/info/1407/1.png',0,1,0,'1','2014-07-08 07:42:26','2014-07-04 13:15:09',''),(4,'大众汽车学院微信公众号7月正式对外服务','wxxw','','&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;微信已成为我们乃至全球人每天不可或缺且是闲时忍不住都要看两眼的主要社交联络工具。它不仅是我们生活中的必需品，也逐渐成为满足培训需求的营养品。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;大众汽车学院与时俱进，在内部经过征名和投票，正式推出微信公众号“&lt;strong&gt;&lt;span style=&quot;color:#0075c1;&quot;&gt;大众汽车中国微学苑&lt;/span&gt;&lt;/strong&gt;”。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;大众汽车中国微学苑汇集了大众汽车学院培训目录概要信息，给您勾画出大众汽车学院主要培训业务框架，以及大众汽车学院和培训中心的介绍。针对大众汽车学院用户，我们还有培训计划查询和培训课程确认，甚至通过微信确认参课的童鞋，还可以获得培训前的暖心短信提醒，培训机会岂容错过。关注大众汽车中国微学苑的各位亲，每月的大众学院新闻，让您与我们一起与时俱进。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;不仅这些，我们还会为您呈现大众汽车中国微学苑的微课堂，敬请期待。&lt;br /&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;img src=&quot;/uploads/info/1502/134710786.jpg&quot; alt=&quot;&quot; /&gt;&lt;/p&gt;','/uploads/info/1502/134719644.jpg',0,1,0,'1','2015-02-11 05:47:19','2014-07-04 13:16:15',''),(5,'明月当空，情谊相交，大众汽车微学苑祝您中秋节快乐','wxxw','','&lt;p class=&quot;p1&quot; style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;span class=&quot;s1&quot;&gt;&amp;nbsp; &amp;nbsp; 明月当空，情谊相交，大众汽车微学苑祝您中秋节快乐。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;点击“&lt;strong&gt;&lt;a href=&quot;hhttp://academy.vgc.com.cn/video/zq/&quot;&gt;进入中秋小游戏&lt;/a&gt;&lt;/strong&gt;”，查看大众汽车微学苑为您特别制作的中秋小游戏。&lt;/p&gt;','/uploads/info/1412/getimgdata.jpg',0,1,0,'1','2015-03-05 02:56:35','2014-09-04 16:00:00',''),(6,'开心度假期 安全伴你行','wxxw','','&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 国庆长假即将来临，相信有不少车友都乘着秋高气爽来一次精彩的自驾游。在自驾游途中，在高速公路上驾驶和长途驾驶是必不可少的，因此，行车途中的安全就显得尤为重要。&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 大众汽车安全驾驶战略的本质在于预防事故的发生，或至少减轻事故的严重程度。&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;br /&gt;&lt;/p&gt;','/uploads/info/1502/112056985.jpg',0,1,0,'1','2015-03-05 02:55:58','2014-09-29 16:00:00',''),(9,'大众创新技术-泊车辅助系统','homenew','http://academy.vgc.com.cn/video/bcfz/index.html','','/uploads/info/1510/110354677.jpg',1,1,0,'0','2015-10-19 03:03:54','2015-01-21 16:00:00',''),(10,'大众创新技术-TSI®发动机技术 ','homenew','http://academy.vgc.com.cn/video/tsi/index.html','','/uploads/info/1510/110329053.jpg',2,1,0,'0','2015-10-19 03:03:29','2015-01-21 16:00:00',''),(11,'大众创新技术-车道保持辅助系统','homenew','http://academy.vgc.com.cn/video/cdbc/index.html','','/uploads/info/1510/110256565.jpg',3,1,0,'0','2015-10-19 03:02:56','2015-01-21 16:00:00',''),(12,'大众创新技术-ACC与前方辅助系统','homenew','http://academy.vgc.com.cn/video/acc/index.html','','/uploads/info/1510/110223984.jpg',4,1,0,'0','2015-10-19 03:02:23','2015-01-21 16:00:00',''),(13,'大众创新技术-TSI®发动机技术','wxxw','http://academy.vgc.com.cn/video/tsi/index.html','&lt;p&gt;TSI&amp;reg;发动机技术是大众汽车的创新技术，它将驾驶乐趣和环境保护完美结合在一起。&lt;/p&gt;&lt;p&gt;我们将向您介绍 TSI&amp;reg;发动机技术的基本知识。&lt;/p&gt;','/uploads/info/1502/123754957.jpg',0,1,0,'0','2015-03-05 02:57:36','2014-12-02 16:00:00',''),(14,'大众创新技术-ACC与前方辅助系统','wxxw','http://academy.vgc.com.cn/video/acc/index.html','&lt;p&gt;大众汽车以 ACC 和前方辅助系统，帮助驾驶者进行日常驾驶。它们可在任何旅途中为驾驶者提供支持。&lt;/p&gt;&lt;p&gt;我们将向您介绍 ACC与前方辅助系统的基本知识&lt;/p&gt;','/uploads/info/1502/123920818.jpg',0,1,0,'0','2015-03-05 02:57:17','2014-12-15 16:00:00',''),(15,'大众汽车中国微学苑祝您圣诞快乐','wxxw','http://academy.vgc.com.cn/video/sd/index.html','大众汽车中国微学苑祝您圣诞快乐','/uploads/info/1502/124114368.jpg',0,1,0,'0','2015-03-05 02:55:35','2014-12-18 16:00:00',''),(16,'大众创新技术-车道保持辅助系统','wxxw','http://academy.vgc.com.cn/video/cdbc/index.html','我们将向您介绍&amp;amp;nbsp;车道保持辅助系统的基本知识','/uploads/info/1502/124222565.jpg',0,1,0,'0','2015-03-05 02:54:01','2015-01-08 16:00:00',''),(17,'大众创新技术-泊车辅助系统','wxxw','http://academy.vgc.com.cn/video/bcfz/index.html','我们将向您介绍&amp;amp;nbsp;泊车辅助系统的基本知识。','/uploads/info/1502/124335756.jpg',0,1,0,'0','2015-03-05 02:53:40','2015-01-20 16:00:00',''),(18,'第5届大众汽车中国培训执委会','wxxw','http://mp.weixin.qq.com/s?__biz=MzA3MzYzMDcwNA==&amp;mid=202733896&amp;idx=1&amp;sn=8becc634530d54942a8f69699e9e1c68#rd','&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 1月27日和28日，第5届大众汽车中国培训执委会在大众汽车学院位于751时尚设计广场的新培训中心召开，来自上海大众、一汽大众和进口大众，以及大众汽车学院，将近五十多位的培训管理者和培训师们参加了本次会议。','/uploads/info/1502/124513827.jpg',0,1,0,'0','2015-03-05 02:53:20','2015-02-05 16:00:00',''),(19,'2015年大众汽车学院培训目录','wxxw','','&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;送马唤羊来，2015年新春假期已经结束，2015年也已经过了2个月。春节前，大众汽车学院出版了最新的2015年培训手册，在此我们将培训手册中的精华内容更新到大众汽车中国微学苑的培训目录中，分享给大家赏阅。&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;说明：请在大众汽车中国微学苑公众号的菜单栏选择“培训目录”，分别查看“培训师认证培训”，“经销商培训”和“业务支持培训”。&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;img data-s=&quot;300,640&quot; data-type=&quot;jpeg&quot; src=&quot;https://mmbiz.qlogo.cn/mmbiz/G9DicMSG0BjZdNZTpIQuWicU2ZIzxxolp6dJwiaibLLia5kao9Z1iagXNQLDlKibt9LZ5pz5muHrhgGodWorFdsbnOtcw/0&quot; data-ratio=&quot;1.4407114624505928&quot; data-w=&quot;506&quot; _src=&quot;https://mmbiz.qlogo.cn/mmbiz/G9DicMSG0BjZdNZTpIQuWicU2ZIzxxolp6dJwiaibLLia5kao9Z1iagXNQLDlKibt9LZ5pz5muHrhgGodWorFdsbnOtcw/0&quot; style=&quot;max-width: 100%; height: auto !important;&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;margin: 5px 0px; clear: both; font-family: sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 人是我们的灵感源泉，也是大众汽车集团“以人为本”战略的核心。大众汽车学院始终将德国标准根植于教学理念之中，将严谨和注重细节和优良品质，源源不断的输送给中国学员。我们不断致力于创新突破，积极引进一批高层次人才，对学院的环境进一步改造， 加强与合作伙伴的深度合作以及在结合本地情况推出了更多的定制化课程。作为首家被授权在德国大众总部以外颁发大众汽车培训证书的培训学院，大众汽车学院始终在依照大众集团全球领先的培训标准，通过对员工提供完善、高质的培训课程，储备优秀的人才资源，打造一流的培训师及服务团队，提升品牌价值、提高客户满意度及忠诚度，进一步巩固大众汽车在中国的领导地位。&lt;/p&gt;&lt;div&gt;&lt;br /&gt;&lt;/div&gt;','/uploads/info/1502/103058880.jpg',0,1,0,'0','2016-02-20 05:26:13','2015-02-27 16:00:00',''),(20,'大众创新技术-丹拿音响系统','wxxw','http://academy.vgc.com.cn/video/dnyx/index.html','','/uploads/info/1503/134838816.jpg',0,1,0,'0','2015-03-10 05:48:38','2015-03-09 16:00:00',''),(21,'大众汽车学院招募销售和技术培训师','wxxw','http://academy.vgc.com.cn/video/zp/index.html','&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;如果你&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是个有激情有梦想的人&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;愿意在汽车行业从事技术、产品或销售培训&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是个很好的&lt;/span&gt;Team Player&lt;span style=&quot;font-family:宋体;&quot;&gt;，能够在团队中主动承担相应的职责&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;而且，你&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有汽车品牌厂家的培训经验&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有很强的英语听说读写能力&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有丰富的汽车驾驶经验&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有&lt;/span&gt;5&lt;span style=&quot;font-family:宋体;&quot;&gt;年以上工作经验&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有学士学位的教育背景&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;有很强的汽车技术专业知识&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;或者曾是一名汽车技术培训师，或产品培训师，或者销售培训师&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;可以清晰地表达和传递学习内容，并激发和引导他人的学习&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;那么，你&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是否愿意和其他&lt;/span&gt;30&lt;span style=&quot;font-family:宋体;&quot;&gt;多位培训同行一起工作&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是否愿意接受德国大众严格的培训师认证体系&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是否愿意接受各种培训需求挑战，协助公司业务发展&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;这些你都可以，那就将你的简历发送到：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;dan.feng@volkswagen.com.cn&lt;/p&gt;&lt;p&gt;提示：邮件中请注明是申请销售培训师还是技术培训师。&lt;/p&gt;','/uploads/info/1503/102041214.jpg',0,1,0,'0','2015-03-25 02:20:41','2015-03-22 16:00:00',''),(22,'大众新车上市-up!','wxxw','http://academy.vgc.com.cn/video/up/index.html','我们将向您介绍大众汽车在中国上市的全新车型up!','/uploads/info/1503/152328667.jpg',0,1,0,'0','2015-03-31 07:23:28','2015-03-30 16:00:00',''),(23,'大众学院手机版开通啦','homenew','','大众学院手机版开通啦','/uploads/info/1510/110451707.jpg',5,1,0,'0','2015-10-20 05:44:46','2015-10-13 16:00:00','');
