49,51,8,'2015-05-02 14:28:09',0,NULL,'218.93.122.68'),(7862,79,189,'2',7849,51,8,'2015-05-02 14:28:09',0,NULL,'218.93.122.68'),(7863,79,190,'2',7849,51,8,'2015-05-02 14:28:09',0,NULL,'218.93.122.68'),(7864,79,191,'2',7849,51,8,'2015-05-02 14:28:09',0,NULL,'218.93.122.68'),(7865,71,192,'备件顾问如何解决客户投诉。',7849,51,8,'2015-05-02 14:28:09',0,NULL,'218.93.122.68'),(7866,71,193,'我觉得挺好的.',7849,51,8,'2015-05-02 14:28:10',0,NULL,'218.93.122.68'),(7867,71,219,'暂时还没有，三天培训时间老师讲了很多内容，我需要一些时间消化，有需求我会给你们写邮件的。',7849,51,8,'2015-05-02 14:28:10',0,NULL,'218.93.122.68'),(7868,0,0,'8',0,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7869,79,174,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7870,77,175,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7871,79,176,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7872,71,177,'个人认为培训人员在8-10人左右比较好，互动及现场氛围可以起到最佳培训状态，学员太少往往达不到一定的效果。',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7873,79,179,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7874,79,180,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7875,79,181,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7876,79,182,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7877,71,183,'销售流程和提升满意度部分，因为本次的销售流程培训和以往的不同，本次使用了落地辅导案例对比及关键流程点的讲述，作为咨询师正是有一些落地使用的方法及技巧，我可以用同样的形式把各流程的增值内容及应对技巧落地罗列运用到实际中。',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7878,71,184,'满意度部分可增加内容，因为现在市场的影响销售不好，店里更用超出客户期望值的服务于客户，体现自身销售服务人员的价值，满意度不仅是销售人员应该如何让全员都意识到服务的高尚，每人都意识到满意度的重要性，从门卫到保洁，从保洁到前台等，如何每个人每个部门都能体现价值那么我们的满意度就不会如此之难做。',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7879,71,185,'可视化教学，易懂、视觉好、清晰',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7880,71,186,'培训老师的培训方法应该不错，能让每一位学员参与其中',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7881,79,188,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.217.232.196'),(7882,79,189,'2',7868,48,8,'2015-05-03 09:22:44',0,NULL,'221.