8,55,8,'2015-05-11 17:50:55',0,NULL,'101.231.156.110'),(8248,0,0,'8',0,55,8,'2015-05-11 22:01:48',0,NULL,'115.203.237.198'),(8249,79,174,'2',8248,55,8,'2015-05-11 22:01:48',0,NULL,'115.203.237.198'),(8250,79,175,'2',8248,55,8,'2015-05-11 22:01:48',0,NULL,'115.203.237.198'),(8251,79,176,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8252,71,177,'首先这是我接受过的学习到相关知识最多的培训，似乎所有我平常培训中能想到的细节都已经做的很到位了，一定要提建议的话，我期盼主办方在课时可以安排的话再多组织我们进行更多场次的培训，我现在对大众品牌文化和大众的涂装工艺流程着迷！！！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8253,79,179,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8254,79,180,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8255,79,181,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8256,79,182,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8257,71,183,'理论！   首先大家本来都是业内人士，交流的时候在技术层面上有较好的沟通基础，张老师可以把一个动作或者说工艺流程描述的非常具体，生动，从头至尾我的学习兴趣一直都能被不断的激发出来，其次目前行业迫切需要提高或者规范的恰好就是授课技巧和沟通技巧方面（本人尤为迫切！）另外张老师在授课过程中讲到的相关联知识可以很好的帮助学员理解，领会涂装工艺的原理，如果仅仅只停留在遵守，那么创新将无从谈起！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8258,71,184,'讲的都很详细，深入浅出，整个培训过程中其实张老师一直都在调整（场控能力真的好强！）应该没有需要删减的。我希望可以在大众品牌文化，发展历程以及真车体验等方面增加一部分内容，这些信息我们可以直接在以后的大众培训课程中回答学员疑问，其次我们对品牌文化和真实的产品更深层次的了解体验之后也会对大众品牌更有自信！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8259,71,185,'理论，因为语言太强大了，我们的每一句话每一个动作都传达着太多的信息量但是我们平常确最容易忽视这些！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8260,71,186,'很坦率的说我整个过程中都在很投入的学习，短短几天的时间需要学习的知识量太大，这个过程中真的很享受，我思考了好久不觉得还有更好的方式可选！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8261,79,188,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8262,79,189,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8263,79,190,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8264,79,191,'2',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8265,71,192,'对现场气氛调节能力，总能激发我们的兴趣和热情！对我们解答问题以及指出不足时的耐心和态度，回答问题不但准确具体还通俗易懂！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8266,71,193,'多才多艺，绅士风度，才华横溢，为人热情诚恳，谦虚好学还热爱运动！实在抱歉！我真心不知道该怎么回答这个问题！',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8267,71,219,'希望可以适当增加培训时间同时给予我更多的演讲机会，以便更完善的指出我的不足之处，希望能参加大众品牌培训和二手车评估培训',8248,55,8,'2015-05-11 22:01:49',0,NULL,'115.203.237.198'),(8268,0,0,'8',0,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8269,79,174,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8270,79,175,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8271,79,176,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8272,71,177,'组织的非常到位，学到了更多的知识及涂装技能，希望参加大众更高级别的培训。',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8273,79,179,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8274,79,180,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8275,79,181,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8276,79,182,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8277,71,183,'全部都喜欢，因为可以指导实际工作。',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8278,71,184,'无',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8279,71,185,'学员参与互动，记忆更深刻，更能指导实际工作。',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8280,71,186,'无需改进',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8281,79,188,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8282,79,189,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8283,79,190,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8284,79,191,'2',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8285,71,192,'专业的理论知识，使学员参与度较高的教学方式，非常受用。',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8286,71,193,'无',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8287,71,219,'大众风格的教学法',8268,55,8,'2015-05-12 08:55:04',0,NULL,'114.244.43.209'),(8288,0,0,'8',0,55,8,'2015-05-12 11:03:51',0,NULL,'101.231.156.110'),(8289,79,174,'2',8288,55,8,'2015-05-12 11:03:51',0,NULL,'101.2