INSERT INTO `selling_point_conent` VALUES ('2255da48fe504a5682c6acb68fffcb50','测试标题','<div class=\"container\">\n	<a href=\"../index.html\">返回目录</a> \n	<p class=\"bt\">\n		车道保持辅助系统 “Lane Assist”\n	</p>\n<br />\n	<div class=\"pic\">\n		<img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/Lane assist.jpg\" />\n	</div>\n<br />\n	<div class=\"content\">\n		<div class=\"content_title\" style=\"width:15%;\">\n			功能\n		</div>\n		<div class=\"content_word\">\n			<p>\n				车道保持辅助系统 “Lane Assist” 的车道偏离预警系统能够通过对方向盘的适度干预，防止驾驶员无意中偏离车道。\n			</p>\n		</div>\n	</div>\n<br />\n<video src=\"/js/kindeditor-4.1.10/plugins/template/html/media/Lane assist.mp4\" controls=\"\" class=\"video\" width=\"100%\"></video>\n    <br />\n	<div class=\"content\">\n		<div class=\"content_title\" style=\"width:30%;\">\n			客户获益点\n		</div>\n		<div class=\"content_word\">\n			<ul type=\"disc\">\n				<li>\n					防止驾驶员无意中偏离\n					<div class=\"container\">\n						<p class=\"bt\">\n							内容模块一\n						</p>\n<br />\n						<div class=\"content\">\n							<div class=\"content_title\" style=\"width:15%;\">\n								功能\n							</div>\n							<div class=\"content_word\">\n								<p>\n									车道保持辅助系统 “Lane Assist” 的车道偏离预警系统能够通过对方向盘的适度干预，防止驾驶员无意中偏离车道。\n								</p>\n							</div>\n						</div>\n<br />\n					</div>\n车道\n				</li>\n				<li>\n					防止因为瞬时注意力不集中而引发事故\n				</li>\n				<li>\n					即使是在天黑情况下，连续车道监控也能帮助减轻驾驶员的压力，并使之能够更加放松和安全地驾车行驶\n				</li>\n			</ul>\n		</div>\n	</div>\n<br />\n	<div class=\"content\">\n		<div class=\"content_title\" style=\"width:25%;\">\n			系统信息\n		</div>\n		<div class=\"content_word\">\n			<ul type=\"disc\">\n				<li>\n					当车速超过 65 km/h 时，车内后视镜上的摄像头就会扫描道路上的实线和虚线标志。\n				</li>\n				<li>\n					在车辆无意中偏离车道时，车道保持辅助系统可以进行连续和适度的干预。\n				</li>\n				<li>\n					如果反转向力不足以将车辆保持在车道内，系统还会通过方向盘的振动对驾驶员进行预警。\n				</li>\n				<li>\n					如果在超出车道标志线之前指示灯已激活，或者当系统发现有意的转向行为时，系统就不会有反应。\n				</li>\n				<li>\n					驾驶员可以毫不费力地随时解除车道保持辅助系统的干预。\n				</li>\n				<li>\n					当只能看到一条车道标志时（如大雾天或黑夜）。车道保持辅助系统仍然可以工作。\n				</li>\n				<li>\n					当驾驶员的手离开方向盘约 8 - 10 秒时，系统就能探测到这种情况。在系统关闭前，会触发警示音。并在组合仪表上显示提醒标志。系统与紧急情况辅助系统一起启动，提醒驾驶员专注驾驶，或者将车辆逐步刹停。\n				</li>\n			</ul>\n		</div>\n	</div>\n<br />\n	<div class=\"content\">\n		<div class=\"content_title\" style=\"width:55%;\">\n			车型详情：全新迈腾\n		</div>\n		<div class=\"content_word\">\n			<p>\n				新迈腾上面装备的是新一代的车道保持辅助系统，有能力不依靠白色的车道线来识别车道，这大大增加了系统的有效性。另外，系统自带自适应性引导线来判断驾驶员是否正常行驶在车道上（靠左，中间，靠右）并且做出相应的调整。\n			</p>\n		</div>\n	</div>\n<br />\n	<div class=\"theme\">\n		<div class=\"theme_name\">\n			相关主题\n		</div>\n		<div class=\"theme_relevant\">\n			<ul>\n				<li>\n					<a href=\"http://academy.vgc.com.cn/vwac/01/002/index.html\"><img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/Front assist.jpg\" /></a>\n				</li>\n				<li>\n					<a href=\"http://academy.vgc.com.cn/vwac/01/013/index.html\"><img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/Side assist with rear traffic alert.jpg\" /></a>\n				</li>\n				<li>\n					<a href=\"http://academy.vgc.com.cn/vwac/01/016/index.html\"><img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/Traffic jam assist.jpg\" /></a>\n				</li>\n			</ul>\n		</div>\n	</div>\n<br />\n</div>',NULL,'2015/11/12 15:33:06',9435377,''),('6a218fa5632445bc973eaaa1b9822baf','点点滴滴','',NULL,'2015/10/30 15:47:22',2767,''),('75521ed8fe924a439168a295ee78eee7','左右布局','<div class=\"container\">\n	<p class=\"bt\">\n		车道保持辅助系统 “Lane Assist”\n	</p>\n	<div class=\"pic\">\n		<img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/Lane assist.jpg\" />\n	</div>\n	<div class=\"vwac_content_left\">\n		<div class=\"vwac_content_inner\">\n			<p>\n				车道保持辅助系统 “Lane Assist” 的车道偏离预警系统能够通过对方向盘的适度干预，防止驾驶员无意中偏离车道\n			</p>\n<br />\n			<p>\n				新迈腾上面装备的是新一代的车道保持辅助系统，有能力不依靠白色的车道线来识别车道，这大大增加了系统的有效性。另外，系统自带自适应性引导线来判断驾驶员是否正常行驶在车道上（靠左，中间，靠右）并且做出相应的调整。\n			</p>\n		</div>\n	</div>\n	<div class=\"vwac_content_right\">\n		<br />\n		<p>\n			<img src=\"/js/kindeditor-4.1.10/plugins/template/html/images/empty_photo1.png\" width=\"100%