080813e98b6b0013eaaee0534001d','双电池方案(Dual Battery Concept)','随着玻璃升降器、座椅加热器、安全保护设备等汽车电子系统和舒适系统的不断增多，汽车供电能力也面临越来越严苛的要求。因此，一些车型根据各自的发动机和设备情况装配了双电池，即起动电池和电控电池。汽车正常行驶时，起动电池为起动机供电，电控电池为电子设备供电。电池的电量由独立的电子监控仪来监督，在一个电池电力不足的情况下，监控仪会调动另一个电池进行相应补充。','VW','sales','2013-05-16 09:22:05','1','ff8080813d0cba87013d144ff8d70007',362,NULL,20,NULL),('ff8080813e98b6b0013eaaef1596001e','4MOTION全时四驱系统','4MOTION是大众汽车的全时四驱系统。\n在4MOTION系统中，发动机的驱动力会根据需求被合理分配到四个轮胎上。\n采用纵置发动机的车型使用托森(Torsen)差速器将驱动力合理分配给汽车前后桥，采用横置发动机的车型则使用Haldex离合器。\n4MOTION的主动安全性强，能在各种路面情况下提供可靠的牵引力，即便在侧风时也能保证汽车始终稳定前行。4MOTION的持续安全性能要明显优于分时四轮驱动系统，此外它还可与所有的汽车动力学控制系统联用，如电子稳定程序(ESP)、驱动防滑系统(ASR)、发动机阻力矩控制系统(MSR)以及电子差速锁(EDS)等。','VW','sales','2013-05-16 09:23:15','1','ff8080813d0cba87013d144ff8d70007',343,NULL,5,NULL),('ff8080813e98b6b0013eaaef6393001f','4XMOTION全时四驱系统(途锐)','4XMOTION是途锐车系的电控全时四驱系统，是其优异越野性能的保证。途锐装配有一个配备多片式离合器和减速器的可锁式中央差速器。汽车正常运行时，中央差速器会根据打滑情况将驱动力合理分配给前后桥，而且还可以通过锁止以实现固定的驱动力分配。如果路况恶劣，驾驶员可以通过底盘开关调到2.69:1的减速比，使汽车在低速行驶时仍能获得最大的驱动力，由此途锐拥有近100%(45°角)的爬坡能力。此外顾客还可选购带横向锁、锁止效果达100%的后桥差速器，是否启用差速器锁(100%锁止)可由驾驶员自行决定。横向锁还能按需要自动激活，以调整汽车的牵引力和动力。','VW','sales','2013-05-16 09:23:35','1','ff8080813d0cba87013d144ff8d70007',344,NULL,7,NULL),('ff8080813e98b6b0013eaaf074780020','弯道辅助照明角灯(Static Cornering Light)','弯道辅助照明角灯(Static Cornering Light)是照亮转弯区域的辅助光源。在十字路口或者转弯处，弯道辅助照明角灯会随着方向盘偏转或者转向灯闪烁自动打亮，这样驾驶员可以立刻发现弯道区域附近的行人，从而降低事故发生率。\n弯道辅助照明角灯由一个独立的卤素灯泡和一个小反射器组成，装在停车灯反射器后面，可照亮35°角、半径为若干米的扇形区域。在大众汽车的最新车型中，弯道辅助照明角灯与雾灯整合为同一个灯。','VW','sales','2013-05-16 09:24:45','1','ff8080813d0cba87013d144ff8d70007',363,NULL,10,NULL),('ff8080813e98b6b0013eaaf0cca30021','尾气排放标准(Abgasnormen)','欧洲汽车尾气排放标准是欧盟的法定标准。它规定了汽车尾气所含有害气体(二氧化硫、氮氧化物、碳氢化合物、一氧化碳、二氧化碳以及柴油燃烧废气的颗粒物)的最高值。自2009年9月，所有欧产新车必须遵守欧洲尾气排放5号标准。\n从2014年起，欧盟立法机构计划施行欧洲尾气排放6号标准。在非欧盟区域，不同国家采用的标准各不相同(如美国施行BIN/LEV标准)。','VW','sales','2013-05-16 09:25:07','1','ff8080813d0cba87013d144ff8d70007',339,NULL,4,NULL),('ff8080813e98b6b0013eaaf127350022','尾气再循环(EGR)','尾气再循环(EGR, Exhaust Gas Recirculation)是指将部分燃烧尾气有序回引到汽缸内参与燃烧的过程。这个过程可以有效降低混合气体燃烧时产生的氮氧化物(NOx)，其作用就是改善汽车尾气的排放。\n燃气与空气的混合气体燃烧时，会随着温度的升高而产生大量的氮氧化物。如果回引部分尾气到汽缸内，可以适当降低汽缸内燃烧气体的温度，以此降低氮氧化物含量。也就是说，可以根据发动机的负荷量来回引尾气，达到改善尾气排放的目的。在尾气再循环过程中，尾气经由相应的管道，通过由发动机管理体系调节的电磁阀进入回收管，然后被吸入汽缸内参与燃烧。','VW','sales','2013-05-16 09:25:31','1','ff8080813d0cba87013d144ff8d70007',383,NULL,10,NULL),('ff8080813e98b6b0013eaaf258220023','废气涡轮增压器(Turbocharger)','废气涡轮增压器(Turbocharger)通过压缩燃烧所需的新鲜空气来增加发动机的进气流量。与(汽缸容积相同的)自然吸气式发动机相比，使用废气涡轮增压器可以提高发动机的功率、扭矩以及燃烧效率。\n涡轮增压器和日常生活中伙房厨灶使用的助燃鼓风机一样，作用是增加空气的进入量，增氧助燃。其结构和原理也和鼓风机非常相似。只不过鼓风机考是由电动机驱动的，而涡轮增压器是由废气驱动的。目前大多数增压器都是由废气驱动的，所以又叫废气涡轮增压器。\n废气涡轮增压器由两个机械式联动的形状跟电风扇形似的叶轮组成。一个叶轮由发动机排出的废气顺路带动，称之为“涡轮”；另一个与涡轮固定在一根轴上的叶轮叫“泵轮”，用来泵入空气。\n发动机的废气在排出时顺路推动涡轮旋转，带动与其同轴的泵轮一起飞速旋转，将空气压缩并泵入进气系统中，增加了进气的密度，也就是增加了进气流量。众所周知，发动机燃烧时燃油量必须与空气量达到一定比例才能发挥最大的效能。由于比自然吸气方式发动机的进气量多，涡轮增压发动机中参与燃烧的燃油也可以增多，发动机输出的动力就得以增加。所以在同等排量的条件下，涡轮增压发动机可以输出更大的功率和扭矩，并获得更高的燃烧效率。此外，它另一优势是节能和减排。','VW','tech','2013-05-16 09:26:49','1','ff8080813d0cba87013d144ff8d70007',338,NULL,5,NULL),('ff8080813e98b6b0013eaaf41ba10024','防抱死制动系统(ABS)','防抱死制动系统(ABS, Anti-Blocking System)旨在防止路面湿滑或完全制动时出现车轮抱死的情况，以此维持汽车的转向能力。\n车轮抱死时，转向牵引力无法传递，汽车方向将失去控制。防抱死制动系统可有效防止该情况的产生。它通过车轮转速传感器来监测各车轮的转速。如果某个车轮即将抱死，ABS系统调控单元中的电磁阀会自动减小该轮的制动力直到车轮自由转动，之后再继续加大车轮制动力直到接近抱死极限值。在此过程中，汽车保持稳定行驶，方向始终可控。\n在所有的大众汽车车型中，这样的防抱死制动过程以每秒能发生若干次。当ABS系统进行调节时，驾驶员能感受到刹车踏板的轻微脉冲。只要车况在防抱死制动系统的工作范围内，汽车即便在制动力达到最大值的情况下也能顺利转向，因此ABS有助于汽车绕开障碍物、防止发生碰撞。\n汽车在某些特殊路面行驶时，如碎石滩或者雪地，ABS可能会延缓制动，加大汽车的制动距离。','VW','sales','2013-05-16 09:28:44','1','ff8080813d0cba87013d144ff8d70007',347,NULL,2,NULL),('ff8080813e98b6b0013eaaf5d46c0025','越野ABS(ABSplus)','越野ABS(ABSplus)是防抱死制动系统(ABS)系统调节仪的一个特别程序，只有在越野环境中(包括速度小于5千米/时、中央差速器被锁止的情况)才会自动启用。\n启用越野ABS时，轮胎可能会在系统减小制动力前短暂地抱死，这样轮胎前会形成一小堆沙土或雪堆阻碍车轮前移、加强刹车效果，但是汽车在这种情况下依然能转弯，而且制动距离会明显缩短。','VW','sales','2013-05-16 09:30:37','1','ff8080813d0cba87013d144ff8d70007',285,NULL,3,NULL),('ff8080813e98b6b0013eaaf61ecf0026','车距雷达(Abstandsradar)','车距雷达(Abstandsradar)是自适应巡航控制系统ACC的组成部分。','VW','sales','2013-05-16 09:30:56','1','ff8080813d0cba87013d144ff8d70007',345,NULL,6,NULL),('ff8080813e98b6b0013eaaf67c7e0027','自适应巡航控制系统(ACC)','自适应巡航控制系统(ACC，Adaptive Cruise Control)系统的车速调节装置通过车距传感器来测量与前方汽车的间隔距离和相对速度。\n驾驶员可按多功能方向盘或者转向臂(根据车型而定)上的功能键来调节所需的车距和车速。在车队中行驶时，多功能仪表盘会对比显示实时车距和目标车距。\n一个车距传感器会持续监督车前约200米的路面范围。驾驶员踩下加速踏板时，ACC系统调节中断，车速加快；踩刹车踏板时，ACC系统即停用。该系统的运行状态会显示在多功能仪表盘上。\n在列队行驶或者堵车时，ACC的制动功能可使汽车完全停住(帕萨特的ACC系统只是启用了发动机制动，在车速小于30 km/h时自行关闭)，之后ACC又能根据情况在3秒钟内自动激活(途锐)。\n','VW','sales','2013-05-16 09:31:20','1','ff8080813d0cba87013d144ff8d70007',346,NULL,4,NULL),('ff8080813e98b6b0013eaaf6cc900028','动态底盘控制系统(DCC)','动态底盘控制系统(DCC, Dynamic Chassis Control)系统可以将汽车底盘调节成正常型、运动型或者舒适型三种模式，同时还配备有可自动调节的电子减震器和电子机械助力转向系统。\nDCC系统始终能针对不同的行驶环境作出相应调整，同时还兼顾车辆的制动、转向和加速情况。\nDCC系统极大完善了汽车的行驶特性。驾驶员不必再局限于某一种底盘架构，只要轻轻一按副仪表盘中的功能键，就能根据个人需求随意选择。','VW','sales','2013-05-16 09:31:41','1','ff8080813d0cba87013d144ff8d70007',334,NULL,9,NULL),('ff8080813e98b6b0013eaaf71cd10029','车用尿素溶液AdBlue','在选择性催化还原转化器(SCR)中，尾气成分氮氧化物(NOx)可以被还原成氮气和水，而且期间不产生任何其他有害物质。该还原过程需要使用工业合成的车用尿素溶液，如置于独立储罐中的AdBlue。该溶液含32.5%的尿素，在进入SCR转化器之前不断被喷入尾气中并与之混合，喷洒量由发动机管理系统根据NOx传感器(位于SCR转化器后方)的数据精确计算。SCR技术属于大众汽车蓝驱技术系列中最有效、最环保的NOx尾气净化技术。','VW','tech','2013-05-16 09:32:01','1','ff8080813d0cba87013d144ff8d70007',408,NULL,12,NULL),('ff8080813e98b6b0013eaaf7798e002a','空气动力学(Aerodynamics)','空气动力学(Aerodynamics)是决定车身结构的一个重要因素，它对汽车的能耗、最高速度以及噪音控制都有影响。要考察汽车的空气动力学特性，可以在风洞中测出车的风阻系数(cw值)。风阻系数受一系列因素的影响，如车身体积(如轿车、旅行车或斜背式车型)和底盘结构等。空气阻力就产生于车身周围空气的挤压以及空气与车身表面的摩擦。\n空气阻力的计算公式是：\n空气阻力=车速2 ×汽车迎风面积×风阻系数cw×½空气密度\n大众汽车的经典车身造型以及窄小的零部件接缝有助于减少空气涡流的产生，使得空气阻力、能耗和CO2排放量都控制在较低范围内。而影响空气阻力最重要的因素是车速，因为车速增加一倍，空气阻力会增加三倍。','VW','tech','2013-05-16 09:32:25','1','ff8080813d0cba87013d144ff8d70007',404,NULL,6,NULL),('ff8080813e98b6b0013eaaf7caef002b','空气动力学雨刷器(Aero Wipers)','大众汽车空气动力学雨刷器(Aero Wipers)拥有稳定的刮刷效果，在汽车高速行驶时也不受影响。\n与传统雨刷相比，空气动力学雨刷器的一大优点是噪音小，这主要得益于与符合空气动力学设计的雨刷片。空气动力学雨刷片较传统雨刷片而言，风阻系数更小、质量更轻，有助减少汽车的CO2排放。空气动力学雨刷臂有极好的刚性，无需其他零件就能给雨刷片施加适当的力度，不会出现传统雨刷常见的磨擦玻璃等问题。再加上刮刷面积大，驾驶员能轻松自如地面对强降雨情况。空气动力学雨刷器因受磨损更小，减小了更换刮片的频率，节约了养车成本。\n此外，空气动力学雨刷器因其独特结构，在高速度或者干燥天气下依然能达到理想的刮刷效果。','VW','sales','2013-05-16 09:32:46','1','ff8080813d0cba87013d144ff8d70007',403,NULL,9,NULL),('ff8080813e98b6b0013eaaf81cca002c','安全气囊(Airbag)','安全气囊(Airbag)与安全带结合使用，能有效降低人体头部、胸部在碰撞事故中严重撞伤的危险。一旦碰撞传感器感应到与安全气囊系统启动临界值相当的碰撞力时，安全气囊控制器会立即启动气体发生器，在35~45毫秒内吹起并弹出气囊。弹出的安全气囊能缓冲头部和上身的撞击，将碰撞力尽可能分散到更大的平面。120毫秒过后，安全气囊开始放气和萎缩。乘客只有在正确系好安全带时才能得到最佳保护，因为气安全囊与安全带预收紧装置是一个协调统一的整体。大众汽车除了提供前置安全气囊外，还提供侧置安全气囊、膝部安全气囊以及头部安全气囊保护体系。','VW','sales','2013-05-16 09:33:07','1','ff8080813d0cba87013d144ff8d70007',402,NULL,6,NULL),('ff8080813e98b6b0013eaaf8754d002d','安全气囊控制器(ACU)','安全气囊控制器(ACU, Airbag Controll Unit)在识别和评估碰撞后，会根据碰撞的性质和严重程度来激活相应的约束保护系统。该仪器借助装设在车纵轴、横轴和垂直轴的(最多达六个)外置加速度传感器(碰撞传感器)来获取碰撞信息，同时借助转率传感器记录车辆纵轴的转动情况。这些传感器之间也会相互对比和调整各自发出的信号，使安全气囊控制器在短时间内判断出碰撞的方向和严重程度，并立即启动相应的约束保护系统。气囊控制器还可通过碰撞信号输出口连接其他的CAN数据总线，帮助救援人员救出伤员。\n大众汽车在约束保护系统的调控技术上不断进取、精益求精，以至于在各种不同的碰撞事故中都能提供最佳的保护措施。前置安全气囊会根据事故的严重程度分两步弹出，这样的分阶段模式可以进一步降低驾驶员和乘客受伤的危险。\n该系统还能够辨别“碰撞”和车辆因侧面摩擦或路面坑洼出现的“强烈震动”，以确保汽车只在碰撞事故中才启用约束保护系统。','VW','tech','2013-05-16 09:33:29','1','ff8080813d0cba87013d144ff8d70007',401,NULL,6,NULL),('ff8080813e98b6b0013eaaf8d3e8002e','电动助力转向主动回正(Active Return)','电动助力转向主动回正(Active Return)属于大众汽车的电子机械助力转向系统的安全舒适功能。它能够感知驾驶员微小的转向动作，并自动调节转向阻力矩，带来前所未有的精确掌控感。主动回正功能为驾驶员省去多余的转向调整动作，提高了转向的安全性和舒适性。','VW','sales','2013-05-16 09:33:54','1','ff8080813d0cba87013d144ff8d70007',400,NULL,10,NULL),('ff8080813e98b6b0013eaaf992e1002f','主动安全装备(Active Safety)','主动安全装备(Active Safety)包括所有主动干预车辆行驶、可在紧急情况下帮助降低危险和避免事故的系统。\n其中最重要的系统包括电子稳定程序(ESP)、制动辅助系统、预碰撞安全系统(Front Assist)以及侧向检测系统(Side Assist)。\n主动安全主要包括以下重要方面：\n- 行驶稳定性：取决于底盘构造(涉及驱动方案、减震缓冲和转向稳定性)以及转向精确性、制动功率和制动稳定性。\n- 乘驾环境安全：尽量减少车体摇晃、底盘和发动机噪音以及通风不良而给乘客带来负面影响。\n- 感知安全：更优越的车用照明设备和改善视线条件(环视、良好的后视，尽量不带死角)。\n- 操作安全：良好的人体工程学设计，各操纵杆和开关(如灯光、雨刷、空调和信息娱乐系统)的布局正确合理，尽可能方便驾驶员触及。\n主动安全和被动安全装置相结合，可为乘客提供最佳的安全防护。','VW','sales','2013-05-16 09:34:42','1','ff8080813d0cba87013d144ff8d70007',399,NULL,11,NULL),('ff8080813e98b6b0013eaafa000d0030','防盗警报装置(ATA)','防盗警报装置(Anti-Theft Alarm System)带有电子防盗锁，可以有效防止车辆被盗。警报声和信号灯闪烁能够吸引行人注意力，吓退偷盗者。一旦车门或车窗被非正常开启，警报装置会对车门和车身的触碰以及超声波信号作出反应，发出紧急鸣叫。超声波系统能感应出破窗而入的不法行为。\n最新一代的防盗警报装置包括一个不受车载电压影响的警报器和一个防车门非法开启的警报器。防盗警报装置在车锁好时自动启用，在车门开启时自动关闭。某些车型的防盗装置还装有方位传感器，可以监测汽车的方位变化(如将车整体运走)并发出警报。防盗警报装置一般鸣叫30秒钟，同时伴随警报灯的持续闪烁。\n防盗警报装置“加强版”还额外提供车身内部监控以及避免汽车被强行拖走的反拖保护功能。','VW','sales','2013-05-16 09:35:10','1','ff8080813d0cba87013d144ff8d70007',398,NULL,9,NULL),('ff8080813e98b6b0013eaafa6bd80031','可翻转式拖挂钩(Schwenkbare Anhängerkupplung)','可翻转式拖挂钩(Schwenkbare Anhängerkupplung )根据车型的不同，可通过电控自动拆卸，也可通过操作车身内部的操纵杆手动拆卸。拆卸后的拖挂钩只能手动重新旋入安装。在不使用时，拖挂钩完全藏置于车下。','VW','sales','2013-05-16 09:35:38','1','ff8080813d0cba87013d144ff8d70007',409,NULL,43,NULL),('ff8080813e98b6b0013eaafbb3580032','驱动防滑系统(ASR)','驱动防滑系统(ASR, Anti-Slip Regulation)为发动机扭矩大的车型带来更大的舒适性和安全性。尤其当汽车在抓地力频繁变换的路面或者湿滑路面上行驶时，驱动防滑系统保证车能在不同车速下平稳地启动、加速，不会出现轮胎打滑或者车身侧滑的情况。\n驱动防滑系统与电子油门(E-Gas)协同工作，还可以利用防抱死制动系统(ABS)的车轮转速传感器。一旦传感器监测到某驱动轮的转速突然增加(打滑)，驱动防滑系统会立即干预发动机调控程序，降低发动机输出扭矩，防止驱动轮打滑。\n驱动防滑系统保证汽车在各种车速下加速时拥有足够的牵引力、行驶稳定性和主动安全性，此外还可减少轮胎磨损。驱动防滑系统还含有电子差速锁(EDS)，属于电子稳定程序(ESP)的组成部分。','VW','sales','2013-05-16 09:37:02','1','ff8080813d0cba87013d144ff8d70007',414,NULL,93,NULL),('ff808081411023160144cedef3250474','二手车成交价',NULL,'VW','usedcar','2014-03-17 15:08:41','2',NULL,1,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff80808141102316014569945e77049a','hghghgjgjh',NULL,'VW','GMTraining','2014-04-16 16:08:22','D',NULL,109,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff80808141102316014666046c99084a','uu',NULL,'VW','product','2014-06-04 16:35:04','D',NULL,125,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff8080814110231601469eb3d7ce084d','sd',NULL,'VW','brand','2014-06-15 16:45:24','D',NULL,124,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff808081411023160149565bec7d0c3b','sf',NULL,'VW','brand','2014-10-28 18:45:05','D',NULL,123,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff8080814110231601495b317b280c3c','啥',NULL,'VW','sales','2014-10-29 17:16:49','D',NULL,122,'ff8080813d0cba87013d144ff8d70007',1,NULL),('ff8080814110231601498ebeacb50c3d','